import React from 'react'

function Contactcard(props){
    return(
        <div className='jokes'>        
            <h3 style = {{display : !props.albumId && 'none'}}>Album Id: {props.albumId}</h3>
            <h3 style = {{color : !props.albumId && 'red'}}>Photo Id: {props.id}</h3>
            <img src = {props.imgUrl}></img>
        </div>

    )
}



export default Contactcard
